import Navbar from './Navbar';
import './PostLogin.css';

function PostLogin() {
  return (
    <div className="post-login-container">
      <Navbar /> {/* Render the Navbar component */}
      <header className="lord-of-the-rings-header">
        <h1>Welcome to Lembas Break üçûüçÉ</h1>
        <p>One Ring to rule them all, and in your productivity, bind them!</p>
      </header>
      <div className="content">
        <h2>Your Journey Begins Here: Click on the Timer Tab to Begin!</h2>
        <p>Click on the Stats Page to View Your Progress</p>
      </div>
    </div>
  );
}

export default PostLogin;
